<section>
    <div class="container">
        <div class="row m-auto justify-content-center">
            <div class="col-md-6 mt-md-3 mt-3 pb-md-5 pd-3">
                <h1 class="mt-4 pb4 text-center" style="font-weight: 600;">Open up your charging infrastructure to the
                    world</h1>
                <p class="text-center">Joining the intercharge network as a charge point operator (CPO) makes your
                    charging stations compatible with hundreds of eMobility charging service providers, giving many more
                    EV drivers the ability to charge up at your stations.</p>
            </div>


        </div>
        <div class="row">
            <div class="col-md-6">
                <hr>
                <div class="mt-3 pb-4 pl-2">
                    <h3 style="font-weight: 600;">Put yourself on the map</h3>

                    <p class="mt-3">Joining the intercharge network puts your charging infrastructure on the world’s
                        largest charging map. Thousands of EV drivers can locate your charging station using their
                        routing app or in-car navigation system.</p>
                </div>
                <hr>
                <div class="mt-3 pb-4 pl-2">
                    <h3 style="font-weight: 600;">Effortless business connections</h3>

                    <p class="mt-3">Our platform opens you up to hundreds of charging service providers and their
                        customers. No complicated negotiations with each individual provider, no more juggling multiple
                        IT interfaces.</p>
                </div>
                <hr>
                <div class="mt-3 pb-4 pl-2">
                    <h3 style="font-weight: 600;">Reaching far and wide</h3>

                    <p class="mt-3">As more EV drivers get direct access to your charging infrastructure, you maximize
                        your reach and revenue. Your charge points will be working at higher capacities and serving a
                        wider range of users.</p>
                </div>
                <hr>
                <div class="mt-3 pb-4 pl-2">
                    <h3 style="font-weight: 600;">Giving EV drivers the best service possible</h3>

                    <p class="mt-3">Customers enjoy a better charging experience at your charge points thanks to the
                        intercharge platform’s built-in access, reservation, and direct payment functionalities.</p>
                </div>



            </div>
